-- ----------------------------
-- Function structure for _nextval
-- ----------------------------
DROP FUNCTION IF EXISTS `_nextval`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `_nextval`(n varchar(50)) RETURNS int(11)
begin  
declare _cur int;  
insert TB_SEQUENCE(name,current_value,_increment)
select n,0,1 from dual where not exists (select current_value from TB_SEQUENCE where name= n);

set _cur=(select current_value from TB_SEQUENCE where name= n);  
update TB_SEQUENCE  
 set current_value = _cur + _increment  
 where name=n ;  
return _cur;  
end
;;
DELIMITER ;
SET FOREIGN_KEY_CHECKS=1;
